        function Action(but) {
            o.acted = true;
            var a = but.g("action");
            if (a == "play") {
                o.actions.Play()
            } else {
                if (a == "pause") {
                    o.actions.Pause()
                }
                if (a == "stop") {
                    v.preload = 0;
                    o.media.Recover();
                    o.actions.Stop()
                }
            }
            if (a == "back") {
                o.actions.Seek(0, false)
            }
            if (a == "fullscreen") {
                o.actions.Fullscreen()
            } else {
                if (a == "normalscreen") {
                    o.actions.Normalscreen()
                }
            }
            if (a == "line") {
                o.actions.Seek(but.g("click") * o.media.duration(), true);
                if (o.continue) {
                    o.continue.write(but.g("click") * o.media.duration(), o.media.duration());
                    o.seekto > 0 ? o.seekto = undefined : '';
                    log('o.seekto 5', o.seekto)
                }
            }
            if (a == "volume") {
                var x = but.g("click");
                x < 0.02 ? x = 0 : '';
                x > 1 ? x = 1 : '';
                if (o.storage && v.volumestore == 1) {
                    localStorage.setItem("pljsvolume", x);
                    if (but.g("click") > 0 || o.system.iphone || v.mutestore == 0) {
                        localStorage.removeItem("pljsmute")
                    } else {
                        localStorage.setItem("pljsmute", 1)
                    }
                }
                o.actions.Volume(x)
            }
            if (a == "mute") {
                if (o.storage && !o.system.iphone && v.mutestore == 1) {
                    localStorage.setItem("pljsmute", 1)
                }
                o.actions.Mute()
            } else {
                if (a == "unmute") {
                    if (o.storage) {
                        localStorage.removeItem("pljsmute")
                    }
                    o.actions.Unmute()
                }
            }
            if (a.indexOf("time") == 0) {
                but.isOn() ? but.Off() : but.On()
            }
            if (a == "rotate") {
                o.media.Rotate()
            }
            if (a == "scale+") {
                o.media.Scale(0.1)
            }
            if (a == "scale-") {
                o.media.Scale(-0.1)
            }
            if (a == "scale") {
                o.media.Scale(0)
            }
            if (a == "live") {
                api("restart");
                but.set("iconopacity", 1)
            }
            if (a == "share") {
                if (exist(o.share)) {
                    o.share.Show();
                    PlaylistClose();
                    SettingsClose()
                }
            }
            if (a == "settings") {
                if (settings) {
                    if (!settings.g("show")) {
                        settings.show()
                    } else {
                        settings.hide()
                    }
                }
            }
            if (a == "playlist") {
                if (exist(v.playlist)) {
                    if (playlist.g("show")) {
                        playlist.hide()
                    } else {
                        setTimeout(function() {
                            playlist.show()
                        }, 100)
                    }
                }
            }
            if (a == "next") {
                o.controls.PlaylistNext()
            }
            if (a == "prev") {
                o.controls.PlaylistPrev()
            }
            if (a == "custom") {
                if (but.s("link") == 1 && but.s("linkurl") != "") {
                    var x = but.s("linkurl");
                    if (x.indexOf('{time}') > -1) {
                        x = x.replace('{time}', (exist(o.continue) ? o.continue.flag().t : o.media.time()))
                    }
                    if (x.indexOf('{file}') > -1) {
                        x = x.replace('{file}', o.media.currentFile())
                    }
                    if (x.indexOf('{title}') > -1) {
                        x = x.replace('{title}', v.title.replace(/,/ig, " "))
                    }
                    but.s("linkpause") == 1 ? o.actions.Pause() : '';
                    var y = x.split(",");
                    if (x.indexOf("api:") == 0) {
                        var z = x.substr(4).split(";");
                        for (var i = 0; i < z.length; i++) {
                            y = z[i].split(",");
                            if (y.length > 1) {
                                api(y[0], y[1], but)
                            } else {
                                api(y[0])
                            }
                        }
                    } else {
                        if (x.indexOf("js:") == 0) {
                            eval(y[0].substr(3) + '(' + (exist(y[1]) ? '"' + y[1] + '"' : '') + (exist(y[2]) ? ',"' + y[2] + '"' : '') + ')')
                        }
                        if (x.indexOf("http") == 0 || x.indexOf("//") == 0) {
                            window.open(but.s("linkurl"), but.s("linktarget"))
                        }
                        if (x.indexOf("download") == 0) {
                            o.actions.Download()
                        }
                        if (x == "api:pipwebkit") {
                            o.media.PipWebkit()
                        }
                    }
                }
            }
            for (var i = 0; i < 10; i++) {
                if (but.s("linkurl") == "settings#" + i) {
                    if (settings) {
                        if (settings.g("show") && settings.g("open") == i) {
                            settings.hide()
                        } else {
                            settings.show();
                            settings.open(i)
                        }
                    }
                }
            }
        };
